import React from "react";
import './Button.css';
import ImageIcon from '@mui/icons-material/Image';

function Image() {
    return (
        <div className="border">
            <center><ImageIcon/></center>
            <center><div>Image</div></center>
        </div>
    )
    }
export default Image;
